            cursor: pointer;
        }
        & input.switch[type="checkbox"]:not(:checked) + label::before{
            content: "";
            position: absolute;
            top: 0;
            left: 0;
            width: 40px;
            height: 20px;
            border: 1px solid rgba(31, 32, 65, 0.25);
            border-radius: 10px;
        }
        & input.switch[type="checkbox"]:checked + label::before{    
            content: "";
            position: absolute;
            top: 0;
