    }    
}
.material-icons {
    position: absolute;
    top: 25%;
    right: 4%;
    color: rgba(31, 32, 65, 0.5);
    z-index: 1;
    cursor: pointer;
    &:hover {
        opacity: 0.8;
    }
    &_purpure {
        background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
        -webkit-background-clip: text;
        -webkit-text-fill-color: transparent;
