            background:#ffffff;
            margin-right: 20px;
            &_active{
                font-weight: 700;
                font-size: 12px;
                line-height: 15px;
                text-transform: uppercase;
                color: rgba(31, 32, 65, 0.5);
                background:#ffffff;
            }
