        padding: 14px 94px 15px;
    }
    &__link {
        position: relative;
        &:hover{
            opacity: 0.8;
        }
    }
}
.bullet-list {
    font-weight: 400;
    font-size: 14px;
    line-height: 24px;
    color: rgba(31, 32, 65, 0.75);
